import Nav from 'react-bootstrap/Nav';
import '../css/Navbar.css';
import React, {Component} from 'react';
import pages from '../pages.json'


class Navbar extends Component {

    constructor(props){
        super(props);

        let handleClick = this.handleClick.bind(this, 'Parameter');
    }

    handleClick = (param) => (e) => {
        console.log('Event', e);
        console.log('Parameter', param);
    };


    NavItem(title, id){
        return (
            <Nav.Item>
                <Nav.Link onSelect={handleClick('Parameter')} activeKey={id} href={"#"+id}> {title} </Nav.Link>
            </Nav.Item>
        )
    }


    render(){
        this.content_left = pages.left.map((item) => this.NavItem(item.title, item.id));
        this.content_right = pages.right.map((item) => this.NavItem(item.title, item.id));

        return (
            <Nav className={"clearfix"}>
                <div className={"left"}>
                    {this.content_left}
                </div>

                <div className={"right"}>
                    {this.content_right}
                </div>
            </Nav>
        )
    }

}




export default Navbar
